import './Intro.css';
import bg from '../../Assets/image.png';


const Intro = () => {
  return (
    <section id='intro'>
      <div className='introContent'>
        <span className='hello'>hello</span>
        <span className='introText'>I'm<span className='introName'>Sergio</span><br/>Web</span>
      </div>
      <img src={bg} alt='' className='bg' />
    </section>
  )
}

export default Intro
